    false,nt"url": null,nt"notes": "This narrative report for Union Slough
    NWR outlines Refuge accomplishments from September through December of 1960. The
    report begins by summarizing the weather conditions, habitat conditions, water conditions,
    and food and cover during this period. Wildlife- including migratory birds, upland
    game birds, furbearers, predators, rodents, mammals, raptors, reptiles, and fish-
    is also covered. The Refuge development and maintenance section discusses physical
    developments, plantings, collections and receipts, and vegetation control. Resource
    management is outlined; topics include grazing and fur harvesting. A progress report
    on field investigations and applied research is also provided. The public relations
    section of the report describes recreational uses, Refuge visitors, Refuge participation,
    and hunting. N-R forms and photographs are attached.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
